import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import CovidSummary from './components/CovidSummary';

ReactDOM.render(
  <React.StrictMode>
    <CovidSummary />
    <img src="/images/covid.png"></img>
  </React.StrictMode>,
  document.getElementById('root')
);
